const yup = require("yup");

const SignInValidation = yup.object().shape({
    email: yup.string().email("Invalid email").required("Required"),
    password: yup
    .string()
    .min(5, "Too Short!")
    .max(20, "Too Long!")
    .required("Required"),
});

export default SignInValidation;
